def send2xlsx(ls,filename='./有效工时统计工具.xlsx'):
    wb=openpyxl.load_workbook(filename)
    sheet=wb['template']
    rowA=2
    rowB=2
    for i in ls[1::2]:
        sheet['A'+str(rowA)].value=i
        rowA+=1
    for i in ls[2::2]:
        sheet['B' + str(rowB)].value = i
        rowB+=1
    wb.save(filename)

def main():
    path = os.getcwd()
    intro(path)
    user,userpass=userinput()
    assert len(user)>=6,'用户名格式不对'
    ls=brower(user,userpass)
    relo=re.compile(r'^(\d\d\d\d)-(\d\d).*$')
    #正则表达式2014-12
    date=relo.search(ls[1])
    #ls[0]是打卡记录 ls[1] 才是符合格式的时间
    file_name=date.group(1)+date.group(2)+'考勤'+'.txt'
    #拼装文件名201412.txt
    path=os.path.join(path,file_name)
    f=open(path,'w+')
    f.seek(0)
    f.write('\n'.join(ls[1:]))
    f.seek(0)
    pyperclip.copy(f.read())
    f.close()
    print('剪切板中已自动复制内容')
    #列表按行写入文件
    createkaoqintool()
    send2xlsx()
    time.sleep(5)


if __name__ == '__main__':
    main()